**Describe the bug**
I am writing a .dll extension that takes in NumPy images from Python and performs inference on them. The inference works fine on a CPU session.  

I then used the CUDA provider in hopes of getting a speedup, using the default settings.

```
    Ort::Session OnnxRuntime::CreateSession(string onnx_path) {
	// Don't declare raw pointers in the headers and try to return a reference here.
	// ORT will throw an access violation.

	Ort::Env env;
	Ort::SessionOptions session_options;
	OrtCUDAProviderOptions cuda_options;
	cuda_options.device_id = 0;
	cuda_options.cudnn_conv_algo_search = OrtCudnnConvAlgoSearchExhaustive;
	cuda_options.gpu_mem_limit = static_cast<int>(SIZE_MAX * 1024 * 1024);
	cuda_options.arena_extend_strategy = 1;
	cuda_options.do_copy_in_default_stream = 1;
	cuda_options.has_user_compute_stream = 1;
	cuda_options.default_memory_arena_cfg = nullptr;
	session_options.AppendExecutionProvider_CUDA(cuda_options);

	session_options.SetGraphOptimizationLevel(
		GraphOptimizationLevel::ORT_ENABLE_EXTENDED);

	wstring widestr = std::wstring(onnx_path.begin(), onnx_path.end());
	const wchar_t* onnx_path_widecstr = widestr.c_str();
	Ort::Session _session = Ort::Session(env, onnx_path_widecstr, session_options);
	return _session;
    }
```

I got a violation access exception when trying to run the session.

```
