**To Reproduce**

The code would not run without the model, data and suitable infrastructure (which I cannot share). However, the main inference code is shown below.

```
py::dict run(string onnx_path, py::dict images, py::list image_stats, py::list np_labels) {
	DataLoader dataloader = DataLoader(images, image_stats, np_labels);
	
	std::vector<string> labels = dataloader.GetLabels();
	unordered_map<int, cv::Mat> frames = dataloader.GetImages();

	OnnxRuntime onnx = OnnxRuntime();
	Ort::Session session = onnx.CreateSession(onnx_path);

	//as of 4th Feb 2022 Onnx only supports allocation on the CPU
	Ort::MemoryInfo memoryInfo = Ort::MemoryInfo::CreateCpu( 
		OrtAllocatorType::OrtArenaAllocator, OrtMemType::OrtMemTypeDefault);

	//onnx.SessionInfo(&session);
	Ort::TypeInfo inputTypeInfo = session.GetInputTypeInfo(0);
	auto inputTensorInfo = inputTypeInfo.GetTensorTypeAndShapeInfo();
	Ort::TypeInfo outputTypeInfo = session.GetOutputTypeInfo(0);
	auto outputTensorInfo = outputTypeInfo.GetTensorTypeAndShapeInfo();

	std::vector<int64_t> inputDims = inputTensorInfo.GetShape();
	std::vector<int64_t> outputDims = outputTensorInfo.GetShape();
	size_t inputTensorSize = vectorProduct(inputDims);
	size_t outputTensorSize = vectorProduct(outputDims);
	std::vector<float> inputTensorValues(inputTensorSize);
	std::vector<float> outputTensorValues(outputTensorSize);

	Ort::AllocatorWithDefaultOptions allocator;
	const char* inputName = session.GetInputName(0, allocator);
	const char* outputName = session.GetOutputName(0, allocator);

	py::dict results;

	for (const auto& [id, frame] : frames) {
		std::vector<Ort::Value> inputTensors;
		std::vector<Ort::Value> outputTensors;
		std::vector<const char*> inputNames{ inputName };
		std::vector<const char*> outputNames{ outputName };

		inputTensors.push_back(Ort::Value::CreateTensor<float>(
			memoryInfo, inputTensorValues.data(), inputTensorSize, inputDims.data(),
			inputDims.size()));
		outputTensors.push_back(Ort::Value::CreateTensor<float>(
			memoryInfo, outputTensorValues.data(), outputTensorSize,
			outputDims.data(), outputDims.size()));

		inputTensorValues.assign(frame.begin<float>(), frame.end<float>());

		try {
			session.Run(Ort::RunOptions{ nullptr }, inputNames.data(),
				inputTensors.data(), 1, outputNames.data(), outputTensors.data(), 1);
		}
		catch (const std::runtime_error& re) {
			std::cerr << "Runtime error: " << re.what() << std::endl;
		}
		catch (const std::exception& ex)
		{
			std::cerr << "Error occurred: " << ex.what() << std::endl;
		}

		int predId = 0;
		float activation = 0;
		float maxActivation = std::numeric_limits<float>::lowest();
		float expSum = 0;

		for (int i = 0; i < labels.size(); i++)
		{
			activation = outputTensorValues.at(i);
			expSum += std::exp(activation);
			if (activation > maxActivation)
			{
				predId = i;
				maxActivation = activation;
			}
		}

		results[id] = labels.at(predId);
	}
	return results;
}
```
The code is taken from https://github.com/leimao/ONNX-Runtime-Inference/blob/main/src/inference.cpp. 

**Expected behavior**
The .dll returns a Python dictionary with image IDs and classifications.

