A PyTorch ResNet34 model is converted into an ONNX model which is used by the C++ OnnxRuntime. But since the model works fine for the CPU provider, I don't see why it would fail with the CUDA provider.

**Describe the bug**
Did a benchmark comparison between Python OnnxRuntime-GPU vs C++ OnnxRuntime-GPU, and found out that the C++ version ran slower than the Python version. My first intuition is that I have initialized the session and CUDA EP wrongly. However, even C++ OnnxRuntime-CPU runs faster than the GPU version, and that is without setting any intra or inter op threads.

**Urgency**
Not urgent, since this is performance issue and not a bug.

